pragma solidity ^0.8.13;
import "contracts/user/UserRegistry.sol";

contract PermissionControl is UserRegistry {
    mapping(address => mapping(address => bool)) internal permissions;

    modifier onlyDoctor() {
        require(roles[msg.sender] == Role.Doctor, "Only doctor allowed");
        _;
    }

    modifier onlyPatient() {
        require(roles[msg.sender] == Role.Patient, "Only patient allowed");
        _;
    }

    function grantPermission(address _address) public onlyPatient {
        require(
            permissions[msg.sender][_address] == false,
            "User already has permission"
        );
        permissions[msg.sender][_address] = true;
    }

    function revokePermission(address _address) public onlyPatient {
        require(
            permissions[msg.sender][_address] == true,
            "You do not have permission"
        );
        permissions[msg.sender][_address] = false;
    }

    function checkPermission(address patient, address doctor)
        public
        view
        returns (bool)
    {
        return permissions[patient][doctor];
    }
}

